svg.script:
  var svgtest = new function()
  {
    window.addEventListener("load", init, false);
    
    function init()
    {
    	document.getElementById("fs").addEventListener("click",hidefs);
    	for(var i=1;i<14;i++)
    	{
    	  document.getElementById(i+"c").addEventListener("click",function(e) {toggleViewPort(e);});
    	  document.getElementById(i+"s").addEventListener("click",function(e) {toggleViewPort(e);});
    	  document.getElementById(i+"h").addEventListener("click",function(e) {toggleViewPort(e);});
    	  document.getElementById(i+"d").addEventListener("click",function(e) {toggleViewPort(e);});
    	}
    }
    
    function toggleViewPort(e)
    {
      var node = e.target;
      var ref = node.getAttribute("xlink:href");
      
      node = document.getElementById("fs");
      node.setAttribute("xlink:href",ref);
      node.setAttribute("class","show");
      document.getElementById("cards").setAttribute("class","hide");
    }
    
    function hidefs()
    {
      node = document.getElementById("fs");
      node.setAttribute("class","hide");
      document.getElementById("cards").setAttribute("class","show");
   }
    
  }();
